import "./App.css";
import Header from "./components/Header";
import Game from "./components/Game";
import Footer from "./components/Footer";

function App() {
  const [count, setCount] = React.useState(0);

  const countHandler = (count) => {
    setCount(count);
  };

  return (
    <div className="App">
      <Header />
      <Game count={countHandler} />
      {/* <aside>Themes</aside>
      <aside>About</aside> */}
      <Footer />
    </div>
  );
}

export default App;
